INSERT INTO `wp_icl_strings` VALUES('800', 'en', 'acf', '70f5dc10df539e724c054463c0e49a05', 'Export Field Groups', NULL, 'LINE', NULL, '0', '', '247d6a2d57d2e058c8a951449ca37c00');
INSERT INTO `wp_icl_strings` VALUES('801', 'en', 'acf', 'bcaac32c11a2565a24c10aeaf59ddfe7', 'Select the field groups you would like to export and then select your export method. Use the download button to export to a .json file which you can then import to another ACF installation. Use the generate button to export to PHP code which you can place in your theme.', NULL, 'LINE', NULL, '0', '', 'df97bb89d0d1f6fd20fa08d4cdb685cc');
INSERT INTO `wp_icl_strings` VALUES('802', 'en', 'acf', '116df7cbcff4b80248a00294aa5fba37', 'Download export file', NULL, 'LINE', NULL, '0', '', 'af78fa68f920c6997016eeae85dfd915');
INSERT INTO `wp_icl_strings` VALUES('803', 'en', 'acf', '3982671af6deaefd5598e850a030accd', 'Generate export code', NULL, 'LINE', NULL, '0', '', '076d2e6807cdd1128dbfc38d928b5ca5');
INSERT INTO `wp_icl_strings` VALUES('804', 'en', 'acf', 'c62e04b9b68d532de8193e4223470f3d', 'Import Field Groups', NULL, 'LINE', NULL, '0', '', '7a4570a3513271e793d45ebce1c60ce4');
INSERT INTO `wp_icl_strings` VALUES('805', 'en', 'acf', 'ce1a4f93943452a701c252d8a3619757', 'Select the Advanced Custom Fields JSON file you would like to import. When you click the import button below, ACF will import the field groups.', NULL, 'LINE', NULL, '0', '', '34faa4677f2105f9154e58662d4c9b8b');
INSERT INTO `wp_icl_strings` VALUES('806', 'en', 'acf', '1aa14e9f377b528b5537d70fbd35c6a2', 'Select File', NULL, 'LINE', NULL, '0', '', '87fae5ef5d3ed912848b4c19e23f91a6');
INSERT INTO `wp_icl_strings` VALUES('807', 'en', 'acf', '72d6d7a1885885bb55a565fd1070581a', 'Import', NULL, 'LINE', NULL, '0', '', '906cfbb685c052143eca744ffa7ef0cb');
INSERT INTO `wp_icl_strings` VALUES('808', 'en', 'acf', '888e67d489cdfe5fea27f91a8d7f62cd', 'Thank you for updating! ACF %s is bigger and better than ever before. We hope you like it.', NULL, 'LINE', NULL, '0', '', '48a0ac6a7faa37b43b34ef5d81ffef7d');
INSERT INTO `wp_icl_strings` VALUES('809', 'en', 'acf', '707b6d21112b266f20ef2bd0e58b9d2d', 'All 4 premium add-ons have been combined into a new <a href=\"%s\">Pro version of ACF</a>. With both personal and developer licenses available, premium functionality is more affordable and accessible than ever before!', NULL, 'LINE', NULL, '0', '', 'b8bf2b7de3ce9fedcda704cb3c27c9c8');
INSERT INTO `wp_icl_strings` VALUES('810', 'en', 'acf', 'a0840cb73b835ad2f4c59dbe8908a755', 'Read more about <a href=\"%s\">ACF PRO features</a>.', NULL, 'LINE', NULL, '0', '', '26c8790c70f802ec2389010fc82c3942');
INSERT INTO `wp_icl_strings` VALUES('811', 'en', 'acf', 'eebe7aece25bb0294ac6b1242cd85d02', 'To help make upgrading easy, <a href=\"%s\">login to your store account</a> and claim a free copy of ACF PRO!', NULL, 'LINE', NULL, '0', '', '2baa2957cfcf221c3b3869ff4d63e657');
INSERT INTO `wp_icl_strings` VALUES('812', 'en', 'acf', '431538ed362ba2ed62d32b6170361af6', 'We also wrote an <a href=\"%s\">upgrade guide</a> to answer any questions, but if you do have one, please contact our support team via the <a href=\"%s\">help desk</a>', NULL, 'LINE', NULL, '0', '', '6e2b5ccd2b192597023c452091aca1d4');
INSERT INTO `wp_icl_strings` VALUES('813', 'en', 'acf', 'c6a5b53c992b8a76a5f69bac9a590641', 'We think you\'ll love the changes in %s.', NULL, 'LINE', NULL, '0', '', 'e9435baafb60a514f287e85ef8260e4c');
INSERT INTO `wp_icl_strings` VALUES('814', 'en', 'acf', '7f469e5b03b4ccd950ac0a94e6448e58', 'Welcome to Advanced Custom Fields', NULL, 'LINE', NULL, '0', '', 'e7ee21a393c5f9c7fa30b6a3939ddf7a');
INSERT INTO `wp_icl_strings` VALUES('815', 'en', 'acf', '87b7b0dd3a2cc1b732d82c67f9f2c3ff', 'A smoother custom field experience', NULL, 'LINE', NULL, '0', '', '4677ac09fe2cf6e036f23af64b4cb4ff');
INSERT INTO `wp_icl_strings` VALUES('816', 'en', 'acf', 'cbde96e62c148f076f9943ea8c0a51ea', 'Improved Usability', NULL, 'LINE', NULL, '0', '', '80d791e0418cd2c107388a287a4b6586');
INSERT INTO `wp_icl_strings` VALUES('817', 'en', 'acf', '072ce84b513903f722b66a79d1fcc83b', 'Including the popular Select2 library has improved both usability and speed across a number of field types including post object, page link, taxonomy and select.', NULL, 'LINE', NULL, '0', '', 'f6d3ad99240b81454a352125ae856151');
INSERT INTO `wp_icl_strings` VALUES('818', 'en', 'acf', '43cee40a78c0f6c6e5716c984de6827b', 'Improved Design', NULL, 'LINE', NULL, '0', '', '8cf59db3e9c34b012f4231755d456544');
INSERT INTO `wp_icl_strings` VALUES('819', 'en', 'acf', '8184e538934be9909f8241e316586623', 'Many fields have undergone a visual refresh to make ACF look better than ever! Noticeable changes are seen on the gallery, relationship and oEmbed (new) fields!', NULL, 'LINE', NULL, '0', '', '7852679e244c6c51492ec1e116cfe913');
INSERT INTO `wp_icl_strings` VALUES('820', 'en', 'acf', '5afa336c423d7f2eb94d8478e2b405dd', 'Improved Data', NULL, 'LINE', NULL, '0', '', 'e1369e7ab796f4530e8bae31c9cf9e2b');
INSERT INTO `wp_icl_strings` VALUES('821', 'en', 'acf', '7e116140550ebb058f33cdef579a1936', 'Redesigning the data architecture has allowed sub fields to live independently from their parents. This allows you to drag and drop fields in and out of parent fields!', NULL, 'LINE', NULL, '0', '', '3553d24d7b4bd98ceb71e5dafee416a5');
INSERT INTO `wp_icl_strings` VALUES('822', 'en', 'acf', 'd1fe61a2bb051c3bb4769beaa6b2c157', 'Goodbye Add-ons. Hello PRO', NULL, 'LINE', NULL, '0', '', '5dd8be8c5008d050e4cf5b3e89e38981');
INSERT INTO `wp_icl_strings` VALUES('823', 'en', 'acf', 'd287a36bc342674557b221d738b03b32', 'Introducing ACF PRO', NULL, 'LINE', NULL, '0', '', '4c3101f04c1c304eb725d87eccf071ce');
INSERT INTO `wp_icl_strings` VALUES('824', 'en', 'acf', '4dfec0112ab40fa33e96b6c9a460cbc7', 'We\'re changing the way premium functionality is delivered in an exciting way!', NULL, 'LINE', NULL, '0', '', '29be2e8591c58e8fe7936902eba11b91');
INSERT INTO `wp_icl_strings` VALUES('825', 'en', 'acf', '35f1fb69e47cb93a747290e173032cec', 'Powerful Features', NULL, 'LINE', NULL, '0', '', 'a04b0cc16dadf99984288fbaa4b80d27');
INSERT INTO `wp_icl_strings` VALUES('826', 'en', 'acf', '0ed7d704d03d3186ccb978ad22b17f00', 'ACF PRO contains powerful features such as repeatable data, flexible content layouts, a beautiful gallery field and the ability to create extra admin options pages!', NULL, 'LINE', NULL, '0', '', '33f6213a5faa49edaec19495761a974b');
INSERT INTO `wp_icl_strings` VALUES('827', 'en', 'acf', '39861c4aaf37ea1b558cd1bb1d6ceaeb', 'Easy Upgrading', NULL, 'LINE', NULL, '0', '', '1c976a0fdc3ae8e40c14855cd663df07');
INSERT INTO `wp_icl_strings` VALUES('828', 'en', 'acf', '97b85ec6773a0a4d9d4e12c24e3d803f', 'Under the Hood', NULL, 'LINE', NULL, '0', '', '1f6661104f5e2c73a6c1b834e4b65de7');
