INSERT INTO `wp_icl_strings` VALUES('5931', 'en', 'upme', '2f4a6bcd7d88c6b5065528db21d271c8', 'The default front-end Reset Password page where new users will sign up.', NULL, 'LINE', NULL, '0', '', '1d16ee7d4ca8433a4cbed47247ae474b');
