INSERT INTO `wp_icl_strings` VALUES('5933', 'en', 'upme', '495d20766ab35b25c5dcb64d59093c57', 'If you wish to change default UPME Member List page, you may set it here. Make sure you have member list shortcode there, for example: <code>[upme_search] [upme group=all view=compact users_per_page=10]</code> is the default.', NULL, 'LINE', NULL, '0', '', '54fd176ffaeaee6f91695b2c4a714670');
INSERT INTO `wp_icl_strings` VALUES('5934', 'en', 'upme', '55705728388d5856e6106bcfe74da483', 'The default front-end Member List page.', NULL, 'LINE', NULL, '0', '', '9c34ab448744a7bffe0679fa9db4f2ee');
INSERT INTO `wp_icl_strings` VALUES('5935', 'en', 'upme', '9149ea329a7edc80bc92fe9608e3a704', 'Redirect Backend Profiles', NULL, 'LINE', NULL, '0', '', '426b3915c3df01bbea70b4580fdd2976');
INSERT INTO `wp_icl_strings` VALUES('5936', 'en', 'upme', '0ba8a2dcb9bb7d80ecdd353bce14f077', 'If checked, non-admin users who try to access backend WP profiles will be redirected to UPME Profile Page specified above.', NULL, 'LINE', NULL, '0', '', 'b86621387084110f1bebe89dd3784161');
INSERT INTO `wp_icl_strings` VALUES('5937', 'en', 'upme', 'df396be4684493e0696d4981a35e41c0', 'Checking this option will send all users to the front-end UPME Profile Page if they try to access the default backend profile page in wp-admin. The page can be selected in the UPME System Pages settings.', NULL, 'LINE', NULL, '0', '', 'd94e71c72a1ccba6cbb564642d128c77');
INSERT INTO `wp_icl_strings` VALUES('5938', 'en', 'upme', '61bfc5dfc532dac691f4ee9644c84efc', 'Redirect Backend Login', NULL, 'LINE', NULL, '0', '', 'b75c27c60e4ed8a3fb476c99bfd77a90');
INSERT INTO `wp_icl_strings` VALUES('5939', 'en', 'upme', '0fdcbd89a0677b660305082c265556d6', 'If checked, non-admin users who try to access backend login form will be redirected to the front end UPME Login Page specified above.', NULL, 'LINE', NULL, '0', '', '95b2c0a2b49c8c69a9d898b0aea142f2');
INSERT INTO `wp_icl_strings` VALUES('5940', 'en', 'upme', 'efb984090faaad6ff84a1c738d282681', 'Checking this option will send all users to the front-end UPME Login Page if they try to access the default backend login form. The page can be selected in the UPME System Pages settings.', NULL, 'LINE', NULL, '0', '', '3d126e34c32af7909c5cc5589145fe3e');
INSERT INTO `wp_icl_strings` VALUES('5941', 'en', 'upme', '2bd683f7c2394ae3f34e27c996ffa5f6', 'Redirect Backend Registrations', NULL, 'LINE', NULL, '0', '', 'e2a3780a9f00a8515cd80f68264f486d');
