INSERT INTO `wp_icl_strings` VALUES('5943', 'en', 'upme', 'ab2965bf37a7642ce04851a60160dba1', 'Checking this option will send all users to the front-end UPME Registration Page if they try to access the default backend registraiton form. The page can be selected in the UPME System Pages settings.', NULL, 'LINE', NULL, '0', '', '15733c5a2e4bc134f1d1983327aafa3d');
INSERT INTO `wp_icl_strings` VALUES('5944', 'en', 'upme', 'd092c486d2db7f9afc2c03390c52d490', 'Redirect After Login', NULL, 'LINE', NULL, '0', '', 'b3e145da9bcbffad132c1e3fd4de94a7');
INSERT INTO `wp_icl_strings` VALUES('5945', 'en', 'upme', '47794d2df7298342f0e5fdc46223ce68', 'Users will be redirected to the page set here after successfully logging in. <br /> You may over-ride this setting for a specific login form by using the shortcode <code>[upme_login redirect_to=\"url_here\"]</code>', NULL, 'LINE', NULL, '0', '', '82dbba9253d5a50e01d5f5393ed726ae');
INSERT INTO `wp_icl_strings` VALUES('5946', 'en', 'upme', '6ee8d71bd685fe19e648f318ef526e12', 'Setting this option to Default will automatically use any redirect specified in the URL, and will not prevent redirect_to set in shortcode option from working. If no redirect is found in the URL and redirect_to option is not set in shortcode option, the login page will simply be reloaded to welcome the logged in user.', NULL, 'LINE', NULL, '0', '', '6668678e2ed2419a14fdb94a5df7514a');
INSERT INTO `wp_icl_strings` VALUES('5947', 'en', 'upme', '3208df6cd3be249f776b87a246ec8cff', 'Redirect After Registration', NULL, 'LINE', NULL, '0', '', '870dbe0ced1a36baf2f39193260e6c93');
INSERT INTO `wp_icl_strings` VALUES('5948', 'en', 'upme', 'd9fa9169c76685c9018084f4aa314792', 'New users will be redirected to the page set here after successfully registering using the UPME registration form. <br /> You may over-ride this setting for a specific registration form by using the shortcode <code>[upme_registration redirect_to=\"url_here\"]</code>', NULL, 'LINE', NULL, '0', '', '5caddc5639f1de82daa6aca2301e39ba');
INSERT INTO `wp_icl_strings` VALUES('5949', 'en', 'upme', '1c193891e2cdd9c8cd448a5bae7570bb', 'Setting this option to Default will show the Register Success message instead of redirecting to a custom page.', NULL, 'LINE', NULL, '0', '', 'a25711809ab757738c7c754980749852');
INSERT INTO `wp_icl_strings` VALUES('5950', 'en', 'upme', 'a94afae6fbedfb99051ffe326e837f71', 'User Selected Passwords', NULL, 'LINE', NULL, '0', '', 'aa3938b484f330336d73e272485d4ed8');
INSERT INTO `wp_icl_strings` VALUES('5951', 'en', 'upme', '1f9b31963907414ab6ba7ebcae375533', 'Enabled, allow users to set password', NULL, 'LINE', NULL, '0', '', 'e593790e9419b2d0bac21eb2886bba05');
INSERT INTO `wp_icl_strings` VALUES('5952', 'en', 'upme', '08a02923a433281d85ce8f87c80c33d6', 'Disabled, email a random password to users', NULL, 'LINE', NULL, '0', '', '92849fdd80c5b1c73014da5a6f5ad1ac');
INSERT INTO `wp_icl_strings` VALUES('5953', 'en', 'upme', 'adb130d0250c207a6a3b09f5f8d0637c', 'Enable or disable setting a user selected password at registration', NULL, 'LINE', NULL, '0', '', '4bd72dc6a44aeadf238bc50f80b271c7');
INSERT INTO `wp_icl_strings` VALUES('5954', 'en', 'upme', '3760a617f1460ba698464e8ab96fe1a3', 'If enabled, users can choose their own password at registration. If disabled, WordPress will email users a random password when they register.', NULL, 'LINE', NULL, '0', '', 'b6f9bc3e7ea8bdeb8640a329fd83eed6');
INSERT INTO `wp_icl_strings` VALUES('5955', 'en', 'upme', 'd5dbd1adc5f5a62ccda9686b077beebe', 'Automatic Login After Registration', NULL, 'LINE', NULL, '0', '', '73824c619ff81c6de8cba712b1a75e7f');
INSERT INTO `wp_icl_strings` VALUES('5956', 'en', 'upme', '765c45f90c9177e32fa4b824ea6d8ee9', 'Enabled, log users in automatically after registration', NULL, 'LINE', NULL, '0', '', '7c341315d8ad3a49b58fb619634048ea');
INSERT INTO `wp_icl_strings` VALUES('5957', 'en', 'upme', 'd4b3d489a9678e800471b3e5e97a9716', 'Disabled, users must login normally after registration', NULL, 'LINE', NULL, '0', '', '333bd7e2ee03ec9118dd833d51fb56d3');
INSERT INTO `wp_icl_strings` VALUES('5958', 'en', 'upme', '1a9cd57b8408cba462f760d172bf2168', 'Enable or disable automatic login after registration.', NULL, 'LINE', NULL, '0', '', 'df7de74111e88194bb1efe78e04fd19c');
INSERT INTO `wp_icl_strings` VALUES('5959', 'en', 'upme', 'e9aa49499f06cfaea870c83ce2966531', 'If enabled, users will be logged automatically after registration and redirected to the page defined in Redirect After Registration setting. If disabled, users must login normally after registration.', NULL, 'LINE', NULL, '0', '', 'ec8263ebc4aead4ad45f0512cd9f1fc6');
INSERT INTO `wp_icl_strings` VALUES('5960', 'en', 'upme', 'f0496da8b450bcad8ebb52d33c65fab9', 'User Profile Approvals', NULL, 'LINE', NULL, '0', '', '518c066cae82105c64eac820074c9615');
INSERT INTO `wp_icl_strings` VALUES('5961', 'en', 'upme', '5bc28760c3cc914a65860613c909b8ef', 'Disabled, new users are not required to get the approval.', NULL, 'LINE', NULL, '0', '', 'b2bdb4f9fcf431119c25634ba71c623d');
INSERT INTO `wp_icl_strings` VALUES('5962', 'en', 'upme', '83e8d310c75821dd5644023bc15f3bf3', 'Enabled, new users must get the approval', NULL, 'LINE', NULL, '0', '', '1a0545698aea05bddcea0ef64aca87e9');
INSERT INTO `wp_icl_strings` VALUES('5963', 'en', 'upme', '847c54f8433fa2c5f0038d2af79ca21b', 'Enable or disable setting a user account approval at registration', NULL, 'LINE', NULL, '0', '', '0183051e850bf58c68690b9aba2f1751');
INSERT INTO `wp_icl_strings` VALUES('5964', 'en', 'upme', '42b2afbdc0bc72ecd4147812c1402dfb', 'If enabled, users must be approved by admin before login. If disabled, new users are not required to get the account approved before login.', NULL, 'LINE', NULL, '0', '', 'a47037e90e4f30ca9d0cb370066f204c');
INSERT INTO `wp_icl_strings` VALUES('5965', 'en', 'upme', '26ef0ae9b0977afb1491d990f7041f5c', 'Email Confirmation', NULL, 'LINE', NULL, '0', '', 'bb1f7b4eb06ff9bf015ec7010c68f118');
INSERT INTO `wp_icl_strings` VALUES('5966', 'en', 'upme', 'fb99bac441ab38cd3f06d9ff72fd7d15', 'Disabled, new users are not required to confirm email', NULL, 'LINE', NULL, '0', '', 'e9134ac98202013fd7793a00a0560824');
INSERT INTO `wp_icl_strings` VALUES('5967', 'en', 'upme', '8cbdf12a928b24edc571c7a70a44cc04', 'Enabled, new users must confirm email to activate', NULL, 'LINE', NULL, '0', '', '225e26529fa803e970f76f7db37b0941');
INSERT INTO `wp_icl_strings` VALUES('5968', 'en', 'upme', 'a8ba87097d93fd97361033a2d3e3bb35', 'Enable or disable setting a user email confirmation at registration', NULL, 'LINE', NULL, '0', '', '91ac1c7ff5c011523e24c717d8327a02');
INSERT INTO `wp_icl_strings` VALUES('5969', 'en', 'upme', '30a6c024991fc20728a155b3fa98c071', 'If enabled, users must confirm email address to activate. If disabled, new users are not required to confirm email address.', NULL, 'LINE', NULL, '0', '', '68dac464289e837bb6a88cf210af50e3');
INSERT INTO `wp_icl_strings` VALUES('5970', 'en', 'upme', '97abaa921b2270031573362f57aad4a4', 'Terms and Conditions', NULL, 'LINE', NULL, '0', '', '953071f1d4c931b5f9517a0c3fcab101');
INSERT INTO `wp_icl_strings` VALUES('5971', 'en', 'upme', '79e44cc5af103c2f861bdc222197a953', 'Disabled, terms and conditions are not shown in registration form', NULL, 'LINE', NULL, '0', '', '447bf7f3f4e9082dc9f2f22d4a791870');
INSERT INTO `wp_icl_strings` VALUES('5972', 'en', 'upme', '58de5137d9d0cb2e9667f7b981839cf5', 'Enabled, terms and conditions are shown in registration form', NULL, 'LINE', NULL, '0', '', 'adbdd80f70de883a23b0bed50ba12d29');
INSERT INTO `wp_icl_strings` VALUES('5973', 'en', 'upme', '211d8fb73006f2c31cd551956543ece7', 'Enable or disable agreeing to terms and conditions at registration', NULL, 'LINE', NULL, '0', '', '851882418f73761d936021454ecb266e');
INSERT INTO `wp_icl_strings` VALUES('5974', 'en', 'upme', '6a0c904ca34ad93017cc65e4320e3401', 'If enabled, users must agree to terms and conditions for registration.', NULL, 'LINE', NULL, '0', '', '78e9cac794b8dd9d76fb8b19a5e5cca6');
INSERT INTO `wp_icl_strings` VALUES('5975', 'en', 'upme', '3ba221d03f020a291806537654d97e24', 'FunCaptcha', NULL, 'LINE', NULL, '0', '', 'f4502d466ba104eb27599f5299a1f282');
INSERT INTO `wp_icl_strings` VALUES('5976', 'en', 'upme', 'f13d389ac03eb83ddf2fea60e366e1ac', 'reCaptcha', NULL, 'LINE', NULL, '0', '', '7b14ed3dbec1ef308f00e6b142eb273f');
INSERT INTO `wp_icl_strings` VALUES('5977', 'en', 'upme', '45d048c35e3cfd449dc0a1b503cd103a', 'Captcha', NULL, 'LINE', NULL, '0', '', 'b5d74f2bed40c106b73c552a09aeb050');
INSERT INTO `wp_icl_strings` VALUES('5978', 'en', 'upme', 'd852993dbe27497a9c25be093331e0ab', 'Captcha Plugin', NULL, 'LINE', NULL, '0', '', '209a22e7227b405d8d4123b52ef7c7b1');
INSERT INTO `wp_icl_strings` VALUES('5979', 'en', 'upme', 'e88fa5462edd7b22ce772544ceeb6da3', 'Select which captcha plugin you want to use on the registration form. Funcaptcha requires the Funcaptcha plugin, however reCaptcha is built into UPME and requires no additional plugin to be installed. <br /> You can enable or disable captcha with shortcode options: <code>[upme_registration captcha=yes]</code> or <code>[upme_registration captcha=no]</code>.', NULL, 'LINE', NULL, '0', '', '315cf380185e2a719f910240dbd4dbe9');
INSERT INTO `wp_icl_strings` VALUES('5980', 'en', 'upme', '541a9d41d483ab69be00e0bdb206328e', 'If you are using a captcha that requires a plugin, you must install and activate the selected captcha plugin. Some captcha plugins require you to register a free account with them, including FunCaptcha', NULL, 'LINE', NULL, '0', '', 'd173154e2108e51bdbfa80ebb68ea17f');
INSERT INTO `wp_icl_strings` VALUES('5981', 'en', 'upme', '711235a7bef1cb7549ba80a08ffa74a7', 'CAPTCHA Field Label', NULL, 'LINE', NULL, '0', '', 'c8fa5c75bcaf9b695a65ad4ca42c28d2');
INSERT INTO `wp_icl_strings` VALUES('5982', 'en', 'upme', '65dc59d949377d781c775d99a0c517c8', 'Enter text which you want to show in form in front of CAPTCHA.', NULL, 'LINE', NULL, '0', '', 'ee7daf4b31f07418c2fd5a4fc7ddb06d');
INSERT INTO `wp_icl_strings` VALUES('5983', 'en', 'upme', 'f2099184a22393642c7081a0608249b2', 'reCaptcha Public Key', NULL, 'LINE', NULL, '0', '', '83b5c3dea9629a5bbfe4c9f1b142bda7');
INSERT INTO `wp_icl_strings` VALUES('5984', 'en', 'upme', '4eb0d87eb6d09d458cf70b1ad63cba20', 'Enter your reCaptcha Public Key. You can sign up for a free reCaptcha account <a href=\"http://www.google.com/recaptcha\" title=\"Get a reCaptcha Key\" target=\"_blank\">here</a>.', NULL, 'LINE', NULL, '0', '', '708f90191342dcf8e4b5e13ddd08e614');
INSERT INTO `wp_icl_strings` VALUES('5985', 'en', 'upme', 'dac49383911bb41c762961c80a62abc1', 'Your reCaptcha kays are required to use reCaptcha. You can register your site for a free key on the Google reCaptcha page.', NULL, 'LINE', NULL, '0', '', '5d32d6feb8df9cd85a1a49ea70a598df');
INSERT INTO `wp_icl_strings` VALUES('5986', 'en', 'upme', 'b457af3e1b9e99eb28363a15717b676c', 'reCaptcha Private Key', NULL, 'LINE', NULL, '0', '', '0fa444d394a6f45c7a0091f0e630f9b6');
INSERT INTO `wp_icl_strings` VALUES('5987', 'en', 'upme', '2d5a54c1360c6b11e4ad923eeed49c78', 'Enter your reCaptcha Private Key.', NULL, 'LINE', NULL, '0', '', '6979978157f762c634637ec477d25ea5');
INSERT INTO `wp_icl_strings` VALUES('5988', 'en', 'upme', '08844fd9efbb19967bf9e887834c6799', 'Register success message', NULL, 'LINE', NULL, '0', '', '25a871677c257ff1a4cdf78a695db0d3');
INSERT INTO `wp_icl_strings` VALUES('5989', 'en', 'upme', '03a5c2740b3b4f9c40261c0239968633', 'Show a text message when users complete the registration process.', NULL, 'LINE', NULL, '0', '', '77ce15ff1b729145b87233a75130cc92');
INSERT INTO `wp_icl_strings` VALUES('5990', 'en', 'upme', '2895b65bb38bcfaa5252061e9cb3b6eb', 'This message will be shown to users after registration is complted.', NULL, 'LINE', NULL, '0', '', 'cbb18a8ef34fe9302a159618e6be89e6');
INSERT INTO `wp_icl_strings` VALUES('5991', 'en', 'upme', 'beb253ee8ce8e4a3b3973c489ca7bbd2', 'Text/HTML below the Register Success message.', NULL, 'LINE', NULL, '0', '', '3c57b8361d6be16245927d58ebedf003');
INSERT INTO `wp_icl_strings` VALUES('5992', 'en', 'upme', 'a314d6b2be30aed7f7eccebadf958191', 'Show a text/HTML content under success message when users complete the registration process.', NULL, 'LINE', NULL, '0', '', '29a6dda56140d61e83842bdc319e8db5');
INSERT INTO `wp_icl_strings` VALUES('5993', 'en', 'upme', 'ba7870cd83873f998495249f1ae029f3', 'This message will be shown to users under the success messsage after registration is completed.', NULL, 'LINE', NULL, '0', '', 'b140f14ccc2a3979d1cf2fe21f4803bf');
INSERT INTO `wp_icl_strings` VALUES('5994', 'en', 'upme', '88dbbea087a6a91c495c7bcc10f19880', 'Select User Role at Registration', NULL, 'LINE', NULL, '0', '', '61439ae13a70e6d05964aa696cc9d25d');
INSERT INTO `wp_icl_strings` VALUES('5995', 'en', 'upme', 'a1df73a882a5ccb78bb3fbc647b451ce', 'If checked, users will be able to select their user role at registration. If you do not understand what this means, leave this option unchecked.', NULL, 'LINE', NULL, '0', '', 'f5ca6b0de9c5c7cbb7b190980982b6a6');
INSERT INTO `wp_icl_strings` VALUES('5996', 'en', 'upme', '05762ecc05237bc06b9d27307e4a482a', 'Checking this option will enable users to select a user role at registration, based on available user roles defined in the choose roles setting.', NULL, 'LINE', NULL, '0', '', 'ac67ddaccceebb251598c08349be6538');
INSERT INTO `wp_icl_strings` VALUES('5997', 'en', 'upme', '420e62c98ac94c2a6a38f21d520275a7', 'Select Role Label', NULL, 'LINE', NULL, '0', '', '401bb216f192c4c23ca9fb846b979301');
INSERT INTO `wp_icl_strings` VALUES('5998', 'en', 'upme', '386843676c34190b25f21a05134f1bde', 'Enter text which you want to show as the label for User Role selection.', NULL, 'LINE', NULL, '0', '', 'e6134dff49fd32cefee3f4a9e80fc070');
INSERT INTO `wp_icl_strings` VALUES('5999', 'en', 'upme', '9a1d862af035da46e0bc058bc1875525', 'Choose User Roles for Registration', NULL, 'LINE', NULL, '0', '', '1eab49ec3d0425cc631228dac8f3d4b3');
INSERT INTO `wp_icl_strings` VALUES('6000', 'en', 'upme', '1ed65d8f5d59929dcf45c7b935f4df40', 'Selected user roles will be available for users to choose at registration. The default role for new users will be always available, you can change the default role in WordPress general settings.', NULL, 'LINE', NULL, '0', '', '8eb43e69e77aa1565557b2152525dff8');
INSERT INTO `wp_icl_strings` VALUES('6001', 'en', 'upme', '04889adee15cd5dd04b25d8c291e8907', 'User roles selected in this section will appear on the registration form. Be aware that some user roles will give posting and editing access to your site, so please be careful when using this option.', NULL, 'LINE', NULL, '0', '', '529b1c0a5e7845f8463a6721df69563c');
INSERT INTO `wp_icl_strings` VALUES('6002', 'en', 'upme', 'fdb6ac59b0b550a5a1a3c27de1341d8e', 'Default Country', NULL, 'LINE', NULL, '0', '', 'af95d0ad68bb3656f4b80b8764000c7c');
INSERT INTO `wp_icl_strings` VALUES('6003', 'en', 'upme', '5f3ad941a000e650165f192d6b939e2b', 'List the countries to be used as default country.', NULL, 'LINE', NULL, '0', '', '9808dd55f46926be1b1b60dc31e9620c');
INSERT INTO `wp_icl_strings` VALUES('6004', 'en', 'upme', 'bc7b10da3589971d677828cb8f7dc957', 'Selected country will appear as the default value for country fields.', NULL, 'LINE', NULL, '0', '', '4b74f7c59d7539593161cd4eaaeb3daa');
INSERT INTO `wp_icl_strings` VALUES('6005', 'en', 'upme', '7d84c0b061944d6ce8f39cfd7edcd207', 'Password Strength Level', NULL, 'LINE', NULL, '0', '', '2ca237e1b5dd9ab1864308d174537ef2');
INSERT INTO `wp_icl_strings` VALUES('6006', 'en', 'upme', '7324e3727807d95037eb19d304fd91ec', 'Weak', NULL, 'LINE', NULL, '0', '', '68ea02518ee975b5d4a6ab49da03854f');
INSERT INTO `wp_icl_strings` VALUES('6007', 'en', 'upme', '87f8a6ab85c9ced3702b4ea641ad4bb5', 'Medium', NULL, 'LINE', NULL, '0', '', '259bbf0d0b6cab240ea799dd99bc5ff9');
INSERT INTO `wp_icl_strings` VALUES('6008', 'en', 'upme', 'c43e0fd449c758dab8f891d8e19eb1a9', 'Strong', NULL, 'LINE', NULL, '0', '', 'a31f4a6d2e584bbfa8490758110d63d9');
INSERT INTO `wp_icl_strings` VALUES('6009', 'en', 'upme', 'ee6fbcafc850d63cea200894a69f12e7', 'Select the level of strength for user password.', NULL, 'LINE', NULL, '0', '', '16b3ce4bf980e68abb9bfc451b37b2de');
INSERT INTO `wp_icl_strings` VALUES('6010', 'en', 'upme', '7f90b70a8b957fbaa8c9cfe416338b2e', 'User password should match the expected criteria required by strength level', NULL, 'LINE', NULL, '0', '', 'bf35c476f6a81e61f0acd3887af3a44f');
INSERT INTO `wp_icl_strings` VALUES('6011', 'en', 'upme', 'c13ee52e8c4eeffe0a5fbf1482d5323a', 'Registration Form Title Message', NULL, 'LINE', NULL, '0', '', '427a3c578cf4a34907c95bd3100130a0');
INSERT INTO `wp_icl_strings` VALUES('6012', 'en', 'upme', 'c2776cc4e936f3325189d74b6960eb18', 'This message provides the title or message for registration form. By default it will say <strong>Your display name will appear here</strong>. Once user starts typing the username, this section will be updated to show the display name.', NULL, 'LINE', NULL, '0', '', 'b2db4dc021b600955cc012102bf067e2');
INSERT INTO `wp_icl_strings` VALUES('6013', 'en', 'upme', 'b145e673e4444ef38af0ff8c4396c74d', 'You can use custom title or custom instructions for this section.', NULL, 'LINE', NULL, '0', '', 'f9eb3650acc82e6a2712a30b17b75d12');
INSERT INTO `wp_icl_strings` VALUES('6014', 'en', 'upme', '63c7ef2f9d4273e6ce54f2218f9f5cab', 'Update Registration Form Title with Display Name', NULL, 'LINE', NULL, '0', '', 'afd14f28b59de99749d08b4ee57457ab');
INSERT INTO `wp_icl_strings` VALUES('6015', 'en', 'upme', '874db373f7614f5090a5f55ec30d397a', 'If checked, once user starts typing the username, this section will be updated to show the display name. By default, it will be checked to allow display name.', NULL, 'LINE', NULL, '0', '', 'fa66b5e27a3fb123a05f3a4fa3d4d4b6');
INSERT INTO `wp_icl_strings` VALUES('6016', 'en', 'upme', '379c2af1629cf4e00066ef1c2dd210ca', 'Unchecking this option will keep the custom title or message from being updated with display name.', NULL, 'LINE', NULL, '0', '', '29a84543980ac14d175aa12857b53273');
INSERT INTO `wp_icl_strings` VALUES('6017', 'en', 'upme', '3237559861d4502c6dd5c7643d422351', 'Captcha on Login Forms', NULL, 'LINE', NULL, '0', '', '814832a7e67299a091d3a9d20d509dd0');
INSERT INTO `wp_icl_strings` VALUES('6018', 'en', 'upme', '64c0bbdab195a59bae58cba3ba46f208', 'If checked, and captcha plugin is enabled, dynamically generated login forms will have captcha verification. This setting is not applied to your own upme_login shortcodes', NULL, 'LINE', NULL, '0', '', '723e017e9801da40aff0305662e62b76');
INSERT INTO `wp_icl_strings` VALUES('6019', 'en', 'upme', '949bb0a1d58aa26c551ff4992c05f4ef', 'Unchecking this option will remove captcha verification from dynamically generated login forms will have captcha verification.', NULL, 'LINE', NULL, '0', '', '030db4bba329d2fdd2f4219e8f0c6748');
INSERT INTO `wp_icl_strings` VALUES('6020', 'en', 'upme', '87a6d0877bda109cffbf59a691c4d8b1', 'Use WP Cron', NULL, 'LINE', NULL, '0', '', '39108fc47a6ac3f26389b830a6c99d85');
INSERT INTO `wp_icl_strings` VALUES('6021', 'en', 'upme', '36d0b89c349d09264407702f2b5fcb4f', 'If checked, UPME will use WP Cron Feature to update User Search Cache.<br /> When usign this option, make sure <code>DISABLE_WP_CRON</code> is not set to <code>TRUE</code> in <code>wp-config.php</code>', NULL, 'LINE', NULL, '0', '', '874fba0a2fd2e8eb6fcc96b0bbbcd521');
INSERT INTO `wp_icl_strings` VALUES('6022', 'en', 'upme', 'aaf07d6274ff4b011c10771f08428fba', 'Using WP Cron will update your search cache automatically at regular intervals.', NULL, 'LINE', NULL, '0', '', 'e3598a7c97687bf515ce44177c5dc7c5');
INSERT INTO `wp_icl_strings` VALUES('6023', 'en', 'upme', 'ccea3d3c258a8f928c32b49ec0ecb051', 'Search Input Mandatory', NULL, 'LINE', NULL, '0', '', 'dd0c3905e5f73771d71a98f82f8d3a30');
INSERT INTO `wp_icl_strings` VALUES('6024', 'en', 'upme', 'a4c40feb16815be8ff196df081a1633f', 'If checked, UPME will not show search results when <code>hide_until_search=true</code> is used and no search input is given.', NULL, 'LINE', NULL, '0', '', 'eb6fb27ab0cc47192ed32894c7dfd018');
INSERT INTO `wp_icl_strings` VALUES('6025', 'en', 'upme', '382b5efb7e9402429193ec63b1f1a7e6', 'Checking this option is useful if you do not want to show all users when submitting the search with no search criteria.', NULL, 'LINE', NULL, '0', '', 'c9642ab84d31a320a9db511915af372e');
INSERT INTO `wp_icl_strings` VALUES('6026', 'en', 'upme', '28abf22ccdfd88b3572f44bb9e9c6601', 'Users are Called', NULL, 'LINE', NULL, '0', '', '8d8930aff8448fc55a37e7c01be88465');
INSERT INTO `wp_icl_strings` VALUES('6027', 'en', 'upme', '398e0b7f3ec774aa33d2dcdd80608170', 'What users are called in your system. Like Members, Doctors, etc.', NULL, 'LINE', NULL, '0', '', '1d9151a505b142cbc13a471e95ff6cb0');
INSERT INTO `wp_icl_strings` VALUES('6028', 'en', 'upme', '9d09228bcb460ed86dd3eb4d3bb8d0c2', 'This will update the text for the search form and search results. The default is Users.', NULL, 'LINE', NULL, '0', '', '796211b3c7968d10f68623359cfc597b');
INSERT INTO `wp_icl_strings` VALUES('6029', 'en', 'upme', '2dda73ac5fdad1de6a95de8d76281b02', 'Combined Search Text', NULL, 'LINE', NULL, '0', '', '2884f91ba0fbb5c71c508ee4fe137894');
INSERT INTO `wp_icl_strings` VALUES('6030', 'en', 'upme', 'babd4b88856a6a4fd517652eecf81ad4', 'Name of Text search field which is used to perform combined search.', NULL, 'LINE', NULL, '0', '', 'fd6b28017569562f0bafe373b6a8bd53');
INSERT INTO `wp_icl_strings` VALUES('6031', 'en', 'upme', '9b4253c6a40a41a80cbe7a42e0977c0e', 'You may choose custom text for the main combined text search field. The default is Combined Search.', NULL, 'LINE', NULL, '0', '', '18e6ea2e038b95c5279ef6e1fee86d26');
INSERT INTO `wp_icl_strings` VALUES('6032', 'en', 'upme', '51cfb8b6b96cc3631b06d4649f4930d9', 'Search Button Text', NULL, 'LINE', NULL, '0', '', '8bdf8660e358ff068236c1dfddd0849b');
