INSERT INTO `wp_icl_strings` VALUES('6701', 'en', 'default', 'cce99c598cfdb9773ab041d54c3d973a', 'Profile', NULL, 'LINE', NULL, '0', '', '7d40e35fa97ba6958dd2f727a7c92804');
INSERT INTO `wp_icl_strings` VALUES('6702', 'en', 'default', 'bc49a7bd37360447641feb4fc7e23c3b', 'Your profile contains information about you (your &#8220;account&#8221;) as well as some personal options related to using WordPress.', NULL, 'LINE', NULL, '0', '', 'c37c18aa47a453841fda46b1d4f948ae');
INSERT INTO `wp_icl_strings` VALUES('6703', 'en', 'default', 'aa6b50ebfd26013f727b5bddd1a0020a', 'You can change your password, turn on keyboard shortcuts, change the color scheme of your WordPress administration screens, and turn off the WYSIWYG (Visual) editor, among other things. You can hide the Toolbar (formerly called the Admin Bar) from the front end of your site, however it cannot be disabled on the admin screens.', NULL, 'LINE', NULL, '0', '', 'b9b4d0532a778cafb41ef6adf422c685');
INSERT INTO `wp_icl_strings` VALUES('6704', 'en', 'default', '9e6f0dc86ef7bdc19ee56da99e6fe5f3', 'Your username cannot be changed, but you can use other fields to enter your real name or a nickname, and change which name to display on your posts.', NULL, 'LINE', NULL, '0', '', 'fbd85f490c3b85a3bf5e88b8c8c6c58c');
INSERT INTO `wp_icl_strings` VALUES('6705', 'en', 'default', 'b9ee24b2ed698a7774a132f859a7440b', 'You can log out of other devices, such as your phone or a public computer, by clicking the Log Out Everywhere Else button.', NULL, 'LINE', NULL, '0', '', '1b241a88804ad03a64423db084510037');
INSERT INTO `wp_icl_strings` VALUES('6706', 'en', 'default', '0691d23eff65b6b03d4b3d9db7c216e3', 'Required fields are indicated; the rest are optional. Profile information will only be displayed if your theme is set up to do so.', NULL, 'LINE', NULL, '0', '', '61ba8be97a75bdc87be4fddf67cf74c6');
INSERT INTO `wp_icl_strings` VALUES('6707', 'en', 'default', '186c34ef9e23e93a45b8eff1d599313c', 'Remember to click the Update Profile button when you are finished.', NULL, 'LINE', NULL, '0', '', '9ed732ddf8988b8c1d7f9e44f5cb4331');
