INSERT INTO `wp_icl_strings` VALUES('7051', 'en', 'default', '3929b55d6d5a486c2c71f53df11c0e3f', 'Plugins extend and expand the functionality of WordPress. Once a plugin is installed, you may activate it or deactivate it here.', NULL, 'LINE', NULL, '0', '', '83e4e8dfa6e1efae4ce164c016ab9d46');
INSERT INTO `wp_icl_strings` VALUES('7052', 'en', 'default', '51f1313ec9b5d180cc14615dd1387c60', 'You can find additional plugins for your site by using the <a href=\"%1$s\">Plugin Browser/Installer</a> functionality or by browsing the <a href=\"%2$s\" target=\"_blank\">WordPress Plugin Directory</a> directly and installing new plugins manually. To manually install a plugin you generally just need to upload the plugin file into your %3$s directory. Once a plugin has been installed, you can activate it here.', NULL, 'LINE', NULL, '0', '', '15d7bccdf696c3630c5f7f715ce7ce31');
INSERT INTO `wp_icl_strings` VALUES('7053', 'en', 'default', '231cf4c70d866b616c21baddaeed0696', 'Troubleshooting', NULL, 'LINE', NULL, '0', '', 'f15a54e254bfb229acb9aa82aac27ebe');
INSERT INTO `wp_icl_strings` VALUES('7054', 'en', 'default', 'fcd99583341d36fed9a308df418b0501', 'Most of the time, plugins play nicely with the core of WordPress and with other plugins. Sometimes, though, a plugin&#8217;s code will get in the way of another plugin, causing compatibility issues. If your site starts doing strange things, this may be the problem. Try deactivating all your plugins and re-activating them in various combinations until you isolate which one(s) caused the issue.', NULL, 'LINE', NULL, '0', '', 'f0345a79c1b5429286734217a80c98ed');
INSERT INTO `wp_icl_strings` VALUES('7055', 'en', 'default', '37a24e605a3cda57698e531f125740bc', 'If something goes wrong with a plugin and you can&#8217;t use WordPress, delete or rename that file in the %s directory and it will be automatically deactivated.', NULL, 'LINE', NULL, '0', '', 'b9b8f473d110eff046e9836bde623ed6');
INSERT INTO `wp_icl_strings` VALUES('7056', 'en', 'default', '56fc533f5bb25b6fc458f26c69ff228b', '<a href=\"https://codex.wordpress.org/Managing_Plugins#Plugin_Management\" target=\"_blank\">Documentation on Managing Plugins</a>', NULL, 'LINE', NULL, '0', '', '863e5f70ed313aadbdb096e73d349639');
