INSERT INTO `wp_icl_strings` VALUES('7123', 'en', 'default', 'c0ed5e3f5e633991901390dd59336cc6', 'You can use the editor to make changes to any of your plugins&#8217; individual PHP files. Be aware that if you make changes, plugins updates will overwrite your customizations.', NULL, 'LINE', NULL, '0', '', 'f835ba39685bf5ad176052a11180bb18');
INSERT INTO `wp_icl_strings` VALUES('7124', 'en', 'default', '3a6f975ff69a55ae7eaed13a73edf702', 'Choose a plugin to edit from the menu in the upper right and click the Select button. Click once on any file name to load it in the editor, and make your changes. Don&#8217;t forget to save your changes (Update File) when you&#8217;re finished.', NULL, 'LINE', NULL, '0', '', 'c80c99d2a5fffdd61acb515297a3738c');
INSERT INTO `wp_icl_strings` VALUES('7125', 'en', 'default', '88dc13179c52b8083ec73e317b2d5338', 'The Documentation menu below the editor lists the PHP functions recognized in the plugin file. Clicking Look Up takes you to a web page about that particular function.', NULL, 'LINE', NULL, '0', '', 'f53280634c7e03c2413c208d3e3e68b2');
INSERT INTO `wp_icl_strings` VALUES('7126', 'en', 'default', '398a09b4f2a68fcc14e71e5338621c16', 'In the editing area the Tab key enters a tab character. To move below this area by pressing Tab, press the Esc key followed by the Tab key. In some cases the Esc key will need to be pressed twice before the Tab key will allow you to continue.', NULL, 'LINE', NULL, '0', '', '9b72248ac990ee4079d76f2eec7faf79');
INSERT INTO `wp_icl_strings` VALUES('7127', 'en', 'default', '0b5d8aeeb0c74419d4028dca5dc744df', 'If you want to make changes but don&#8217;t want them to be overwritten when the plugin is updated, you may be ready to think about writing your own plugin. For information on how to edit plugins, write your own from scratch, or just better understand their anatomy, check out the links below.', NULL, 'LINE', NULL, '0', '', '8c4742c33256ee314435258e3a200070');
INSERT INTO `wp_icl_strings` VALUES('7128', 'en', 'default', '27657231fa7992f16bc31cf0bf5fc6f0', '<a href=\"https://codex.wordpress.org/Plugins_Editor_Screen\" target=\"_blank\">Documentation on Editing Plugins</a>', NULL, 'LINE', NULL, '0', '', '0ad9512c763c0abe9a7e6878b350e058');
INSERT INTO `wp_icl_strings` VALUES('7129', 'en', 'default', '4f1a104e64bdaba29190944499144e8b', '<a href=\"https://codex.wordpress.org/Writing_a_Plugin\" target=\"_blank\">Documentation on Writing Plugins</a>', NULL, 'LINE', NULL, '0', '', 'f1f053f95668a75b16d3c22e30ae94d7');
INSERT INTO `wp_icl_strings` VALUES('7130', 'en', 'default', 'a4f3c0bd49a3ccc21bc3ae6e85ad0605', 'Function Name&hellip;', NULL, 'LINE', NULL, '0', '', '9effa85fcbe64c02a3e6b3b6c39db03b');
INSERT INTO `wp_icl_strings` VALUES('7131', 'en', 'default', '2c1512ca56bf9338caa2a6adec0faaf1', 'Editing %s (active)', NULL, 'LINE', NULL, '0', '', '8268fa6366a34d36aafe8d554b033ba8');
INSERT INTO `wp_icl_strings` VALUES('7132', 'en', 'default', 'c10c2595dfe5c22c0bdfcf1d0df64c71', 'Select plugin to edit:', NULL, 'LINE', NULL, '0', '', 'a9a48793f9e57be2e386da70b9cad1f3');
