INSERT INTO `wp_icl_strings` VALUES('7134', 'en', 'default', '8faa7616b66ec7990abd90e6eb970b03', 'Documentation:', NULL, 'LINE', NULL, '0', '', 'fcd9481c665fa335d7240da76a4d32c9');
INSERT INTO `wp_icl_strings` VALUES('7135', 'en', 'default', '839c0633140c82c4d0b78941a54f9618', 'Look Up', NULL, 'LINE', NULL, '0', '', 'bf83a27eacaae22d6ef01fc1c7849142');
INSERT INTO `wp_icl_strings` VALUES('7136', 'en', 'default', 'f328ed86868263a7adc2baa053255436', '<strong>Warning:</strong> Making changes to active plugins is not recommended. If your changes cause a fatal error, the plugin will be automatically deactivated.', NULL, 'LINE', NULL, '0', '', 'c910724d22737c7681cde22e146dc68b');
INSERT INTO `wp_icl_strings` VALUES('7137', 'en', 'default', 'e9812bb9eba65f60200270a20c9aa460', 'Update File', NULL, 'LINE', NULL, '0', '', '3e76ce0827f5ae625ad925ad2b4921e7');
